    "2015-10-15T05:58:30.647712",nt"name": "advanced-photon-source-aps",nt"isopen":
    false,nt"url": null,nt"notes": " The Advanced Photon Source (APS) at the
    U.S. Department of Energy&amp;#39;s Argonne National Laboratoryprovides this nation&amp;#39;s
    (in fact, this hemisphere&amp;#39;s) brightest storage ring-generated x-ray beams
    for research in almost all scientific disciplines. These x-rays allow scientists
    to pursue new knowledge about the structure and function of materials in the center
    of the Earth and in outer space, and all points in between. The knowledge gained
    from this research can impact the evolution of combustion engines and microcircuits,
    aid in the development of new pharmaceuticals, and pioneer nanotechnologies whose
    scale is measured in billionths of a meter, to name just a few examples. These studies
    promise to have far-reaching impact on our technology, economy, health, and our
    fundamental knowledge of the materials that make up our world. The APS electron
    accelerator and storage system are the first critical steps in producing the high-energy
    x-rays that are used for frontier research.  ",nt"license_title": "License
